INSERT INTO `contents` (`id`, `label`, `typeId`, `languageId`, `applicatorId`, `realisationId`, `caseStudyId`, `documentId`, `pageElementId`,  `createdAt`, `updatedAt`) VALUES
(1, "<p><span><strong><span><span><span>Thaïs Rénovation - Groupe intermédiaire Habitat</span></span></span></strong></span></p><p><span><span><span>Thaïs Rénovation - Groupe Intermédiaire Habitat est une société d'envergure nationale spécialisée dans le contrôle et la rénovation de l'habitat.</span></span></span></p><p><span><span><span>Notre équipe d'experts spécialisés est à votre disposition pour répondre à tous vos besoins concernant votre habitation.</span></span></span></p><p><span><span><span>Une maison bien entretenue et équipée avec des produits de qualité, c'est l'assurance de :</span></span></span></p><p><span><span><span>​</span></span></span></p><ul>	<li><span><span><span><span>faire des économies sur notre consommation d'énergie (notamment concernant le chauffage)</span></span></span></span></li>	<li><span><span><span><span>limiter notre impact sur l'environnement (en réduire nos émissions de CO</span></span><span><span>2</span></span><span><span>)</span></span></span></span></li>	<li><span><span><span><span>augmenter sa valeur ce qui n'est pas négligeable.</span></span></span></span></li></ul><p> </p><p><span><span><span>C'est pourquoi nous avons choisi de sélectionner au sein d'une même entité des professionnels qualifiés dans tous les domaines de l'amélioration de l'habitat, tant sur le plan structurel que sur l'esthétique et le confort :</span></span></span></p><p><span><span><span>​</span></span></span></p><ul>	<li><span><span><span><span>L'isolation</span></span></span></span></li>	<li><span><span><span><span>Les travaux de couverture, zinguerie et maçonnerie</span></span></span></span></li>	<li><span><span><span><span>Les menuiseries</span></span></span></span></li>	<li><span><span><span><span>Les traitements</span></span></span></span></li>	<li><span><span><span><span>La façade</span></span></span></span></li>	<li><span><span><span><span>Le chauffage</span></span></span></span></li>	<li><span><span><span><span>Le confort et le bien-être</span></span></span></span></li>	<li><span><span><span><span>La sécurité de votre lieu de vie</span></span></span></span></li></ul><p> </p><p><span><span><span>Votre maison est un bien précieux, ne la négligez pas !</span></span></span></p><p><a href=\"https://www.facebook.com/GIH-groupe-intermediaire-habitat-307968169612750/\"><span><span><span>https://www.facebook.com/GIH-groupe-intermediaire-habitat-307968169612750/</span></span></span></a></p>", 1, NULL, 131, NULL, NULL, NULL, NULL, "2018-09-01 09:35:59", "2018-09-01 09:35:59"),
(2, "<p>Belet Isolation, c'est 30 ans de savoir-faire au service de l'isolation thermique et acoustique</p><p>Nous sommes implantés depuis 1975 en Aveyron, et réalisons tous vos travaux d'isolation thermique et acoustique, sur le Grand Sud-Ouest.</p><p>Une équipe jeune et dynamique sera heureuse de vous accueillir, d'étudier, de concevoir vos projets pour la réalisation de travaux d'isolation de vos bâtiments industriels, commerces et particuliers pour habitation neuve ou en rénovation.</p>", 1, NULL, 139, NULL, NULL, NULL, NULL, "2018-09-01 09:35:59", "2018-09-01 09:35:59"),
(3, "<p>Bureau de L’Habitat Français est une EURL spécialisée dans la rénovation des maisons individuelles. Notre politique commerciale est axée sur le respect du client et la qualité de nos interventions. Nous sommes tellement sûr de votre satisfaction que nous avons adopté notre « contrat de confiance », c’est à dire aucun are ni acompte tant que le travail n’est pas terminé et vérifié par une personne qualifiée</p>", 1, NULL, 142, NULL, NULL, NULL, NULL, "2018-09-01 09:35:59", "2018-09-01 09:35:59"),
(4, "<p>Nous mettons notre expérience au service de nos clients ²pour assurer une bonne expertise, une recherche de solution adapté et un travail de qualité.</p><p>Chaque projet est étudié de manière collégiale avec mes collaborateurs.</p><p>Les études de devis font l’objet de concertation pour offrir le meilleur rapport qualité prix «  la bonne solution  est celle qui sera compatible avec le support, le souhait esthétique du client et son budget.</p>", 1, NULL, 135, NULL, NULL, NULL, NULL, "2018-09-01 09:35:59", "2018-09-01 09:35:59"),
(5, "<p>DJP ENERGY est une société SPÉCIALISÉE dans le développement durable.</p><p>Son produit phare ? L’ECOREGULATEUR DJP PERMET D’ÉCONOMISER PLUS DE 20% de fuel /gaz/électricité.</p>", 1, NULL, 136, NULL, NULL, NULL, NULL, "2018-09-01 09:35:59", "2018-09-01 09:35:59"),
(6, "<p>DNH 06 est une société spécialisée dans la vente et pose de revêtements innovants. Assurer l’imperméabilité, la protection et l’isolation de vos surfaces et bâtiments, c’est son coeur de métier.</p><p>Implantée sur Cannes et agréée, DNH 06 intervient sur toute la région PACA et vous assure une prestation fiable et de haute qualité.</p>", 1, NULL, 259, NULL, NULL, NULL, NULL, "2018-09-01 09:35:59", "2018-09-01 09:35:59"),
(7, "<p><span><span><span>Effi </span><span>Therma:  </span></span></span>Distributeur - Applicateur<span><span> ThermaCote HAUTS DE FRANCE</span></span></p><p><span>Effi Therma projette le THERMACOTE peinture isolante sur Murs, Toitures et industries sur tous supports dans les Hauts de France.</span></p><img alt=\"effitherma\" data-align=\"center\" src=\"/sites/default/files/inline-images/effitherma.jpg\" /><p> </p>", 1, NULL, 132, NULL, NULL, NULL, NULL, "2018-09-01 09:35:59", "2018-09-01 09:35:59"),
(8, "<p>Europ Nettoyage accompagne tous vos projets</p><p>Prenez soin de votre habitat ! En faisant confiance à nos artisans, vous réduisez considérablement vos factures énergétiques… et en même temps vous faites un geste pour la planète !</p>", 1, NULL, 133, NULL, NULL, NULL, NULL, "2018-09-01 09:35:59", "2018-09-01 09:35:59"),
(9, "<p>FaçaDéco intervient sur les départements en Seine Maritime et l'Eure.</p><p>FaçaDéco propose auprès des particuliers le ravalement à la chaux, tout type de ravalement, enduit gratté, peinture, isolation extérieur, bardage et peinture hydrofuge de toiture</p>", 1, NULL, 263, NULL, NULL, NULL, NULL, "2018-09-01 09:35:59", "2018-09-01 09:35:59"),
(10, "<p>L'entreprise <a href=\"https://www.grenaillage-peinture-metallisation.fr/\">GIPM</a>, située à <a href=\"https://www.grenaillage-peinture-metallisation.fr/nous-trouver/\">Sainte-Hélène-sur-Isère</a> dans le département de la Savoie (73) est spécialisée dans le sablage, les systèmes anti-corrosion, et le thermolaquage de différents types de métaux.</p><p>Grâce à notre savoir-faire, nous vous fournissons des solutions efficaces pour la remise à neuf de vos supports et objets en métal.</p><p>Nous assurons les traitements de surface par le sablage, le grenaillage ainsi que le traitement anticorrosion par l'application de différents types de revêtements.</p><p>Nous adaptons des traitements spécifiques à chaque type de matériaux, tenant compte de sa fragilité ou de sa solidité.</p>", 1, NULL, 255, NULL, NULL, NULL, NULL, "2018-09-01 09:35:59", "2018-09-01 09:35:59"),
(11, "<p>Spécialiste de la rénovation et de l'isolation de l'habitat, notre société de proximité regroupe 3 agences DINAN - RENNES et ARGENTAN.</p><p>Des conseils professionnels pour votre isolation thermique, isolation combles perdus, nettoyage toiture et façade, traitement de charpente en Côtes d’Armor (22) et Ille et vilaine (35), Orne (61)</p><p>UN SEUL INTERLOCUTEUR, DU CONSEIL A LA POSE</p><p>L’isolation par soufflage de coton ISOTEXTIL</p><p>Le traitement de charpente</p><p>Le nettoyage de toiture et façade avec une gamme exclusive de produits EXCELL+</p><p>L'isolation de votre toiture, mur et façade par peinture ThermaCote</p><p>Economie Energie jusqu'à 30%</p><p>Valorisation de votre patrimoine</p><p>Confort d'hiver en préservant la chaleur</p><p>Confort d'été en conservant la fraicheur</p><p>Réduction des émissions C02 pour préserver notre planète</p><p>Une santé mieux préservée</p><p><em>L'Energie la moins chère et la plus propre est celle qu'on ne consomme pas</em></p>", 1, NULL, 275, NULL, NULL, NULL, NULL, "2018-09-01 09:35:59", "2018-09-01 09:35:59"),
(12, "<p><span>La Société <a href=\"http://www.isolation-plus.fr/\">ISOLATION PLUS</a> est une Entreprise spécialisée dans les travaux d'Isolation et de Rénovation (Intérieure/Extérieure) clés en mains.</span></p><p><span>Un seul interlocuteur pour toute la durée des travaux.</span></p><p><span><a href=\"http://www.isolation-plus.fr/\">ISOLATION PLUS </a>gère votre Chantier du sol au plafond, de la toiture à vos peintures:</span></p><p><span>- Aménagement / Isolation des combles</span></p><p><span>- Réalisation de Salles de Bains</span></p><p><span>- Fourniture et pose de Cuisines</span></p><p><span>- Fourniture et pose de Menuiseries</span></p><p><span>- Plâtrerie</span></p><p><span>- Peintures</span></p><p><span><a href=\"http://www.isolation-plus.fr/\">ISOLATION PLUS</a> s'engage à utiliser des matériaux respectant l'environnement et utilise des produit innovants comme le <a href=\"http://www.thermacote.eu/fr\">Thermacote</a>.</span></p><p><span><a href=\"http://www.isolation-plus.fr/\">ISOLATION PLUS</a> s'affaire à respecter les délais, le travail soigné et n'a qu'une ligne de conduite: la Satisfaction du Client!</span></p>", 1, NULL, 257, NULL, NULL, NULL, NULL, "2018-09-01 09:35:59", "2018-09-01 09:35:59"),
(13, "<p>Créée en 2009, Isole Plus est leader sur le secteur de la bourgogne franche comté dans le domaine de la rénovation thermique globale des maisons individuelles.</p><p>La société intervient pour vos besoins en isolation et rénovation énergétique : isolation des combles, isolation par l’extérieur et rénovation des toitures. Nous vous conseillons sur toute la globalité de votre projet.</p>", 1, NULL, 265, NULL, NULL, NULL, NULL, "2018-09-01 09:35:59", "2018-09-01 09:35:59"),
(14, "<p>Kalisole, le spécialiste de l'isolation thermique</p><p>La société Kalisole à Ajaccio</p><p>Crée en 2010, <strong>Kal'isole est une entreprise innovante</strong> qui a su s'adapter aux besoins des collectivités et particuliers en matière d'<strong>isolation thermique</strong> en étant la première entreprise insulaire à développer le concept de <strong>polyuréthane projeté</strong>.<br /> <br />La société est aujourd'hui forte d'une expérience et d'un savoir-faire, développées depuis maintenant 5 ans d'applications du produit et de plus de <a href=\"https://www.santunione.com/Nos-realisations_r10.html\">75 000 m² de travaux réalisés</a>.</p><p>La performance thermique alliée à l'étanchéité à l'air.</p><p><strong>Spécialiste de l'isolation durable</strong>, notre vocation est d’apporter des solutions d'isolations innovantes aux particuliers et aux professionnels ayant un projet de construction ou de rénovation tout en répondant parfaitement  aux exigences de la Réglementation Thermique 2012 (RT 2012).</p>", 1, NULL, 273, NULL, NULL, NULL, NULL, "2018-09-01 09:35:59", "2018-09-01 09:35:59"),
(15, "<p>L'artisan <strong>Maolet.Y</strong>,<strong> </strong>situé à <strong>Chelles </strong>dans la<strong> Seine-et-Marne</strong>, est spécialisé dans la <strong>couverture, </strong>le <strong>ravalement </strong>de <strong>façades</strong>, la <strong>peinture</strong>, la <strong>charpente</strong><strong> </strong>et l'<strong>isolation</strong>.<br /><br />Notre entreprise a été créée il y a maintenant 8 ans mais <strong>notre</strong><strong> expérience remonte à 15 ans</strong>  expérience que nous mettons <strong>à votre service</strong> pour vous proposer une <strong>prestation </strong>de <strong>qualité</strong>.<br /><br />Nous réalisons des <strong>études personnalisées </strong>afin de s'adapter à <strong>chaque projet </strong>et réalisons nos <strong>devis gratuitement</strong>.<br /><br />Nous aimons vous suivre sur le <strong>long terme </strong>afin de vous accompagner dans vos <strong>projets</strong>.<br /><br />Nous appliquons la <strong>garantie décennale</strong>.<br /><br />Nous intervenons principalement dans la <strong>Seine-et-Marne</strong>  et dans toute l<strong>'Ile-de-France</strong> : <strong>Paris </strong>, <strong>Seine-et-Marne</strong>, <strong>Yvelines </strong>, <strong>Essonne </strong>, <strong>Hauts-de-Seine</strong> , <strong>Seine-Saint-Denis</strong>, <strong>Val-de-Marne</strong> et <strong>Val-d'Oise</strong>.<br /> </p>", 1, NULL, 264, NULL, NULL, NULL, NULL, "2018-09-01 09:35:59", "2018-09-01 09:35:59"),
(16, "<p><strong>Meilleur Habitat Français </strong>est le spécialiste de l'<strong>isolation</strong> dans la région de Nancy, en Lorraine. Une équipe de techniciens vous proposent les meilleurs conseils et réalisations concernant l'isolation des combles perdus, des murs intérieurs et de la sous-toiture.</p>", 1, NULL, 276, NULL, NULL, NULL, NULL, "2018-09-01 09:35:59", "2018-09-01 09:35:59"),
(17, "<p>Située à <strong>Haguenau</strong>​ et dotée de près de 15 ans d'expérience, <strong>Narinlik</strong><strong> </strong>vous propose ses services dans tout le département du <strong>Bas-Rhin </strong>(67).<br /><br />Notre entreprise est spécialisée dans les travaux d'<strong>isolation extérieure</strong>, de <strong>ravalement</strong> de façades et de <strong>peinture </strong>intérieure comme extérieure sur tous types de supports, dans le <strong>neuf</strong> ou l'<strong>ancien</strong>.</p><p>Nous intervenons également pour les travaux de <strong>rénovation</strong>, de <strong>décoration</strong> et de <strong>petites maçonneries</strong>.<br /><br />Nous sommes reconnus <strong>RGE</strong> (Reconnu Garant de l'Environnement) et certifiés <strong>Qualibat</strong>, vous permettant, en plus d'avoir un gage de notre travail de qualité, d'accéder aux différents avantages fiscaux (crédit d'impôt, TVA réduite), aux éco-primes, aux offres de financements à taux réduit et aux aides et subventions de l'état.</p><p>Narinlik vous propose un interlocuteur unique qui suivra toutes les étapes de votre projet : découverte de vos besoins, matérialisation de votre projet, suivi de votre chantier, réception de celui-ci et service après-vente.</p><p>Parce que votre satisfaction est notre maître mot, nous fournissons un travail soigné et de qualité dans le respect des normes et des délais.</p><p> </p>", 1, NULL, 262, NULL, NULL, NULL, NULL, "2018-09-01 09:35:59", "2018-09-01 09:35:59"),
(18, "<p>Un partenaire de référence dans le domaine du ravalement, de la peinture et de la décoration. Entreprise familiale devenue société de premier plan, PACA PEINTURE DESCAMPS bénéficie aujourd’hui d’une large clientèle sensible à son savoir-faire. Doté d’une expertise reconnue, elle est une référence du BTP en P.A.C.A pour les travaux de ravalement, de peinture et de décoration.</p><p>Les activités principales d’alors, la peinture et le revêtement des sols et murs, se sont étendues dans les années 2000 aux domaines tels que peinture industrielle, ravalement, imperméabilisation et étanchéité des façades, isolation thermique par l’extérieur, ainsi que la réhabilitation de logements et la décoration intérieure.</p>", 1, NULL, 266, NULL, NULL, NULL, NULL, "2018-09-01 09:35:59", "2018-09-01 09:35:59"),
(19, "<p><a href=\"http://www.polyrem.eu/\">POLYREM </a>du chantier<br />TRAVAUX SPECIAUX – Particuliers / Bâtiment / Industrie<br />• Traitement de Façades – Isolation<br />• Systèmes d’Étanchéité / Isolation Liquides<br />• Réparation des Bétons – Cuvelages – Pare-Vapeurs<br />• Scellement – Calage – Traitement Joints / Fissures<br />• Résines de Sols / Murs – Peintures Techniques<br />• Protection / Rénovation des Matériaux</p><p><a href=\"http://www.polyrem.eu/\">POLYREM</a>:<br />Nous sommes une Équipe soudée, pluridisciplinaire, technique et très spécialisée dans les Travaux Spéciaux en Bâtiment, Industrie, Génie Civil et Ouvrages d’art.<br />Nous maitrisons la mise en oeuvre des Produits et Techniques de Pointe, comme les Résines, les Matériaux Composites et Hydrauliques Modifiés, pour assurer la garantie et la pérennité de nos Systèmes, Avec Logique, Méthode et Savoir Faire, nous oeuvrons aussi bien, sur des ouvrages en neuf, comme sur des rénovations lourdes.<br />Nous sommes au service des Maitres d’Ouvrage Publics (Administrations, Collectivités, Entreprises de Service Public), ou, Privés (Particuliers, Copropriétés, Syndics, Industriels, Promoteurs…), auprès des Maitres d’OEuvre (Architectes, Experts, Décorateurs, Économistes, Bureaux d’Études…), en sous-traitance pour les entreprises (Gros OEuvre, générales ou de second oeuvre non spécialisées) du Bâtiment ou du Génie Civil.<br /><br /><a href=\"https://fr-fr.facebook.com/people/Polyrem-Travaux-Sp%C3%A9ciaux/100009143982756\"><span>SUIVEZ-POLYREM SUR FACEBOOK</span></a></p>", 1, NULL, 258, NULL, NULL, NULL, NULL, "2018-09-01 09:35:59", "2018-09-01 09:35:59"),
(20, "<p><strong>Techniloc</strong> est devenue un acteur de choix dans le domaine de l’hydrodémolition, de <strong>l’hydrodécapage</strong> et du <strong>nettoyage industriel</strong> très haute pression (jusqu’à 2500 bars).</p><p>De nombreux domaines d’activités utilisent la <strong>Très Haute Pression</strong> : l’industrie, les travaux publics, le bâtiment, les chantiers navals, etc.</p>", 1, NULL, 254, NULL, NULL, NULL, NULL, "2018-09-01 09:35:59", "2018-09-01 09:35:59"),
